def prime_factors(lst):
    num = lst[88]
    def get_prime_factors(n):
        i = 2
        factors = []
        while i * i <= n:
            if n % i:
                i += 1
            else:
                n //= i
                factors.append(i)
        if n > 1:
            factors.append(n)
        return set(factors)
    return get_prime_factors(num)
